import Expenses from './Components/expenses/Expenses';
import NewExpnese from './Components/NewExpenses/NewExpense';
function App() {
  let expenses = [
    {
      id: 'e1',
      title: 'Toilet Paper',
      amount: 94.12,
      date: new Date(1995, 2, 17),
    },
    { id: 'e2', title: 'New TV', amount: 799.49, date: new Date(1995, 2, 17)},
    {
      id: 'e3',
      title: 'Car Insurance',
      amount: 294.67,
      date: new Date(1995, 2, 17),
    },
    {
      id: 'e4',
      title: 'New Desk (Wooden)',
      amount: 450,
      date: new Date(1995, 2, 17),
    },
  ];
  const finaloutput=(expense)=>{
    console.log(expense);
  }
  return (
    <div>
      <h2>Let's get started!</h2>
      <NewExpnese importobj={finaloutput}></NewExpnese>
      <Expenses array={expenses}/>
    </div>
  );
}

export default App;
